import React from "react";
import "../style/PurchasePagesub.css";
import addcart from "../images/purchase_sub/addcart.png";
import bread from "../images/purchase_sub/bread.png";
import icons from "../images/purchase_sub/icons.png";

function PurchasePagesub() {
  return (
    <section className="product">
      <div className="content">
        <div className="pic_bread">
          <img src={bread} alt="" />
        </div>
        <div className="text">
          <h1>香料番茄醬(全素)</h1>
          <p>NT$780</p>
          <hr />
          <p>
            尺寸: 50x30cm <br /> 品牌: 棉花花 <br />
            認證: 國際有機天然食品認證 <br />
            成份: 亞麻仁、椰子粉、米穀粉、玫瑰鹽、天然酵母、天然奶油 <br />
            橄欖油、黑胡椒、孜然粉、白芝麻、綜合堅果、阿拉伯糖{" "}
          </p>
          <figure className="icons">
            <img src={icons} alt="" />
          </figure>
          <div className="buy">
            <p>-</p>
            <div className="frame"></div>
            <p>+</p>
          </div>
          <figure>
            <img src={addcart} alt="" />
          </figure>
        </div>
      </div>
    </section>
  );
}
export default PurchasePagesub;
